#import "DMHeartDataProvider.h"

@interface DMHeartDataProvider ()

@property (nonatomic, strong) NSArray *heartRateData;
@property (nonatomic, assign) BOOL running;

@property (nonatomic, strong) NSTimer *timer;
@property (nonatomic, assign) NSUInteger index;

@end

@implementation DMHeartDataProvider

- (instancetype)init
{
    self = [super init];
    if (self) {
        [self initializeHeartRateData];
    }
    return self;
}

- (void)initialize
{
    
}

- (void)start
{
    self.running = YES;
    self.timer = [NSTimer scheduledTimerWithTimeInterval:1
                                                  target:self
                                                selector:@selector(heartRateDataReceived)
                                                userInfo:nil
                                                 repeats:YES];
}

- (void)stop
{
    self.running = NO;
    [self.timer invalidate];
    self.timer = nil;
}

- (void)heartRateDataReceived
{
    if (self.index == self.heartRateData.count - 1) {
        self.index = 0;
    }
    DMHeartData *hrData = [[DMHeartData alloc] init];
    hrData.timestamp = [[NSDate date] timeIntervalSince1970];
    hrData.heartRate = [(NSNumber*)[self.heartRateData objectAtIndex:self.index] doubleValue];
    if (self.delegate) {
        [self.delegate heartDataReceived:hrData];
    }
    self.index++;
}

